@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix soma: <http://www.ease-crc.org/ont/SOMA.owl#> .
@prefix dul: <http://www.ontologydesignpatterns.org/ont/dul/DUL.owl#> .
@prefix geo: <http://www.opengis.net/ont/geosparql#> .
@prefix xsd: <http://www.w3.org/2001/XMLSchema#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .
@prefix psr: <https://w3id.org/psr-task#> .

## Knowledge Graph of Actions
psr:Restore_Kitchen a psr:Instruction ;
  psr:hasNaturalLanguage "Restore the kitchen to an organized state by identifying all misplaced items and returning them to their standard storage locations based on their type and function."@en ;
  psr:hasWorkflow psr:Organize_Kitchen .

psr:Organize_Kitchen a psr:Workflow ;
  psr:hasAction psr:Pick_Up_Items ;
  psr:precedes psr:Organize_Kitchen .

psr:Pick_Up_Items a dul:Action ;
  psr:actsOn psr:Evian_Bottle ;
  psr:isAffordedBy soma:PickingUp .

psr:Pick_Up_Items a dul:Action ;
  psr:actsOn psr:M&M's_Box ;
  psr:isAffordedBy soma:PickingUp .

psr:Pick_Up_Items a dul:Action ;
  psr:actsOn psr:Shortbread_Box ;
  psr:isAffordedBy soma:PickingUp .

psr:Pick_Up_Items a dul:Action ;
  psr:actsOn psr:Jello_Box ;
  psr:isAffordedBy soma:PickingUp .

psr:Pick_Up_Items a dul:Action ;
  psr:actsOn psr:Alpen_Salt_Box ;
  psr:isAffordedBy soma:PickingUp .

psr:Pick_Up_Items a dul:Action ;
  psr:actsOn psr:Peanut_Butter_Jar ;
  psr:isAffordedBy soma:PickingUp .

psr:Put_Items_Into_Cabinet a dul:Action ;
  psr:actsOn psr:M&M's_Box ;
  psr:isAffordedBy soma:PuttingDown .

psr:Put_Items_Into_Cabinet a dul:Action ;
  psr:actsOn psr:Shortbread_Box ;
  psr:isAffordedBy soma:PuttingDown .

psr:Put_Items_Into_Cabinet a dul:Action ;
  psr:actsOn psr:Jello_Box ;
  psr:isAffordedBy soma:PuttingDown .

psr:Put_Items_Into_Cabinet a dul:Action ;
  psr:actsOn psr:Alpen_Salt_Box ;
  psr:isAffordedBy soma:PuttingDown .

psr:Put_Items_Into_Cabinet a dul:Action ;
  psr:actsOn psr:Peanut_Butter_Jar ;
  psr:isAffordedBy soma:PuttingDown .

psr:Put_Items_Into_Cabinet a dul:Action ;
  psr:actsOn psr:Evian_Bottle ;
  psr:isAffordedBy soma:PuttingDown .

## Objects
psr:Evian_Bottle a psr:Object, psr:Component ;
  rdfs:label "Evian Bottle"@en .

psr:M&M's_Box a psr:Object, psr:Component ;
  rdfs:label "M&M's Box"@en .

psr:Shortbread_Box a psr:Object, psr:Component ;
  rdfs:label "Shortbread Box"@en .

psr:Jello_Box a psr:Object, psr:Component ;
  rdfs:label "Jello Box"@en .

psr:Alpen_Salt_Box a psr:Object, psr:Component ;
  rdfs:label "Alpen Salt Box"@en .

psr:Peanut_Butter_Jar a psr:Object, psr:Component ;
  rdfs:label "Peanut Butter Jar"@en .
